import React from 'react';

class NumberButtons extends React.Component
{
    render() {
        return (
            <div style={{width:"30pc", justifyContent:"space-between"}}>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("1")}>1</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("2")}>2</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("3")}>3</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("4")}>4</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("5")}>5</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("6")}>6</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("7")}>7</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("8")}>8</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber("9")}>9</button>
                <button type="button" className="btn btn-warning" onClick={() => this.props.changeNumber(" ")}>C</button>
            </div>
        );
    }
}

export default NumberButtons;
